(4981, 242, 0, 1, 'DEMO 粗框眼鏡', '', '2011-02-10 00:00:00', 0000, 0, 1, 7, '周末夜晚走在大街上\r\n我看到短褲短裙貼身背心到處在晃\r\n他們身材修長高挑胸部又wow\r\n但是有個身影特別不一樣\r\n\r\n他那清秀瓜子臉龐多神祕\r\n看來有點單純有點無辜又有一點皮\r\n可以害羞可以玩得很盡興\r\n是因為小巧尖挺鼻子上那副粗框眼鏡\r\n\r\n\r\n赫！我的愛你在哪裡 粗框 眼鏡\r\n赫！擺動柔軟的腰際 跟著 屁股 旋律\r\n\r\n\r\n午夜一點走進煽情的club\r\n我看到滿場蕾絲大腿襪配上彩色的bra\r\n她們身材修長高挑胸部又wow\r\n但是有個身影特別不一樣\r\n\r\n他那清秀瓜子臉龐多神祕\r\n看來有點單純有點無辜又有一點皮\r\n可以很開可以夾得緊緊緊\r\n是因為小巧堅挺鼻子上那副粗框眼鏡\r\n\r\n\r\n我的粗框眼鏡~~~ 你在哪裡~~~\r\n粗框眼鏡~~~ 你在哪裡~~~', '', 212, '', '', '', '', '', '', 0, 0, 1, '2008-05-31 12:22:11', '2013-10-07 17:12:24', '0000-00-00 00:00:00'),
