(4985, 1883, 0, 1, '蛻變', '這首歌 這首歌是勝虧寫的 因為他想改變當時的自己 這首歌有點80 METAL的感覺 \r\n一樣還是有很多FUNK的手法 現在是我們的開場歌曲', '0000-00-00 00:00:00', 0000, 15, 2, 7, '無奈 湧出我心田 受不住 這世間 狂醉與悲\r\n\r\n 用力睜開眼 看不見彩色的明天\r\n\r\n 風走過不留痕跡  抬頭望天空 想看清\r\n 是否有屬於我的天空  尋找著美麗的彩虹  無限寬闊\r\n\r\n 世界盡頭 祈禱著希望降落  那剎那 是種念頭\r\n 拋棄過去的傷痛\r\n\r\n 忍住悲 遊走悔恨間  想逃脫 犯的罪 無奈沈眠\r\n\r\n 矇蔽我雙眼  是不是 希望只是夢\r\n\r\n 揮別過去 傷痛 問自己可曾覺悟過\r\n 找尋著屬於我的天空 美麗彩虹不會走 伸出雙手\r\n\r\n 看見盡頭 希望降落在心中 那剎那 是種過錯 期待蛻變的傷口\r\n \r\n*風走過不留痕跡 抬頭望天空 想看清\r\n 是否有屬於我的天空 尋找著美麗的彩虹 無限寬闊\r\n\r\n 世界盡頭 祈禱著希望降落 那剎那 是種念頭\r\n 拋棄過去  傷痛\r\n \r\n 睜開眼 望著天 期待嶄新的明天  無奈怎能閉上雙眼 \r\n 那剎那 是種過錯 期待蛻變的傷口 我看見盡頭', '', 382, '', '勝虧', '李濟 阿貴', 'smash&光頭', '', '', 0, 1, 0, '2008-06-02 14:28:28', '2015-03-12 13:32:42', '0000-00-00 00:00:00'),
