(5057, 1895, 625, 1, '臨暗', '', '2004-11-01 00:00:00', 0000, 25, 0, 17, '', '臨暗（客語）　 \n　　 \n臨暗，收工　一個人行，佇都市 \n捱目珠吊吊頭臚冇冇　 \n蓋像自家已經　灰飛腦散 \n　 \n三不時捱失神走誌　浪浪蕩蕩穿弄過巷 \n盡想聽一聲　阿姆籲細人仔洗身 \n盡想鼻一下　竈下裏煎魚炒菜介味氣 \n　 \n臨暗，愐起　阿公講介家族史　 \n捱等這房歷代犁耙碌碡（註） \n今捱都市打拚　愛學開基祖 \n　　 \n暮麻，一個人 行中山路　輐中正路 \n論萬盞火照毋光　腳下介路 \n人來人去算毋利 冇人好問　食飽餵冇 \n　　 \n註：「犁」、「耙」、「碌」、「碡」皆為傳統農具；「歷代犁耙碌碡」意謂歷代皆務農。 \n\n______________________________________ \n　　 \n臨暗（國語） \n　　 \n傍晚，收工 一個人走，在都市 \n我眼珠吊垂頭顱虛脹　 \n好像自已已經　魂飛魄散 \n \n三不時我失神走誌　浪浪蕩蕩穿弄過巷 \n直想聽一聲　母親喚孩子洗澡 \n直想聞一下　廚房裏煎魚炒菜的味道 \n \n傍晚，想起　阿公講的家族史 \n我們這房歷代犁耙碌碡　 \n今我都市打拚　要學開基祖 \n \n夜暗，一個人 行中山路　轉中正路 \n上萬盞燈照不亮　腳下的路 \n人來人去算不盡 無人可問　吃飽了沒 ', 391, '', '', '', '', '', '', 1, 1, 0, '2008-06-02 22:05:05', '2015-03-12 13:32:45', '0000-00-00 00:00:00'),
