(5064, 1895, 625, 8, '冇頭冇路', '', '2004-11-01 00:00:00', 0000, 25, 0, 17, '', '作詞：鍾永豐   作曲：林生祥\n世界打發朝晨頭 暈頭暈腦捱緊飄\n都市動身像車班 車班緊發捱冇票\n\n世界換索臨暗頭 有眼冇神捱緊飄\n都市照轉像車班 人客下車捱冇票\n\n捱像零件，托存介\n所有故事，多餘介\n人世同捱，冇關係\n捱驚睹到，相識介\n\n有魂冇主捱緊飄 命運邊唇捱緊飄\n邊唇插滿選舉旗 頭前冇路捱緊飄\n\n頭前冇路捱緊飄\n\n捱冇頭冇路捱緊飄', 289, '', '', '', '', '', '', 1, 1, 0, '2008-06-02 22:10:15', '2015-03-12 13:32:46', '0000-00-00 00:00:00'),
