(5134, 1886, 631, 2, '永遠在一起', '', '2007-05-03 00:00:00', 0000, 30, 0, 1, '夜幕低垂 南瓜馬車閃耀著   盛大舞會 擠滿怕孤單的人\r\n照亮了 不夜城 煙火五彩繽紛   我貼近你的體溫\r\n\r\n酒精麻醉 煙霧瀰漫了雙眼   熱鬧慶典 火熱氣球飛上天\r\n我隨著 搖擺樂 自然而然轉圈   閉上眼許個願希望你聽見\r\n\r\n永遠 都要在一起   帶我看世界最迷你的大象遊行\r\n華麗的馬戲 糖果屋頂   魔術師換上鮮豔的外衣\r\n\r\n永遠都要在一起   你為我戴上隱形的魔法面具\r\n發光的階梯 通往夢境   嘉年華夜晚多美麗 永遠都和你在一起\r\n\r\n歡樂佳節 夜空飄下了白雪	相互依偎 你的手為我取暖\r\n緊握著 不鬆開 空氣也進不來   我靠緊你的胸懷\r\n\r\n香檳汽水 微醺染紅我的嘴  捨不得說再見 眼神沾了水\r\n雪花下 我期待 今天不說晚安  閉上眼許個願再也不分開\r\n\r\n永遠 都要在一起   帶我看世界最迷你的大象遊行\r\n華麗的馬戲 糖果屋頂   魔術師換上鮮豔的外衣\r\n\r\n永遠都要在一起   你為我戴上隱形的魔法面具\r\n發光的階梯 通往夢境   嘉年華夜晚多美麗\r\n\r\n發光的階梯 通往夢境	\r\n嘉年華夜晚多美麗   永遠都和你在一起\r\n\r\n', '', 211, '', '許哲珮', '許哲珮', '陳建良/許哲珮', '種子音樂', '', 1, 1, 0, '2008-06-03 19:55:22', '2015-03-12 13:32:48', '0000-00-00 00:00:00'),
(5135, 1886, 631, 3, 'Finding Neverland', '', '2007-05-03 00:00:00', 0000, 30, 0, 1, '有些事情不必解釋得太過清楚\r\n偶爾模糊不算犯多大的錯誤\r\n我只相信眼睛看到的世界\r\n什麼錯與對 和我沒有關聯\r\n\r\n恐懼佔領我的思緒腦袋沒有 氧氣\r\n是誰將我的城堡 粉碎剩下灰燼\r\n怎麼耳朵聽見天使的聲音\r\n可我聽不見 自己的呼吸\r\n\r\nHey Peter Pan 帶我飛往世界的角落\r\n緊握住手中的夢 別讓那陣風吹走\r\n\r\nWhere’s Neverland 傳說中守護夢的樂園\r\n我乘著白色翅膀飛 (多遠)\r\n沒有悲傷 沒有眼淚\r\n\r\n我還學著飛 循著遠方微亮光芒指引我夢在眼前 會實現\r\n\r\n', '', 282, '', '許哲珮', '許哲珮', '陳建良/許哲珮', '種子音樂', '', 1, 1, 0, '2008-06-03 19:58:05', '2015-03-12 13:32:48', '0000-00-00 00:00:00'),
(5136, 1886, 631, 4, '白日夢飛行', '', '2007-05-03 00:00:00', 0000, 30, 0, 1, '一口一口我吃掉潮溼的天氣\r\n發霉了過期了悶壞的心情\r\n你去了哪裡弄丟你的救生艇\r\n我划呀划呀找尋你的蹤跡\r\n一不小心 沈入深深海底\r\n\r\n終於實現幻想變成了一條魚\r\n不知不覺我闖入誰的陷阱\r\n我以為老天爺指引我逃生梯\r\n我游啊游啊原來只是空氣\r\n變成泡泡 慢慢飛向白雲\r\n\r\n乘著白日夢飛行\r\n前往下一個夢境\r\n隨便我想去哪裡 我是大地\r\n\r\n跟著白日夢飛行\r\n變成國王或螞蟻\r\n世界在我眼裡變成雨一滴\r\n蒸發了傷心 我飛行\r\n\r\n', '', 233, '', '許哲珮', '許哲珮', '林揮斌', '種子音樂', '', 1, 1, 0, '2008-06-03 20:05:05', '2015-03-12 13:32:48', '0000-00-00 00:00:00'),
(5137, 1886, 631, 5, '皇宮前的手風琴 - Interlude', '', '2007-05-03 00:00:00', 0000, 30, 0, 1, '', '', 32, '', '', '', '許哲珮', '種子音樂', '', 1, 1, 0, '2008-06-03 20:05:33', '2015-03-12 13:32:48', '0000-00-00 00:00:00'),
(5138, 1886, 631, 6, '德國下雪了', '', '2007-05-03 00:00:00', 0000, 30, 0, 1, '11月 天氣轉涼 你準備 行李一箱\r\n捨不得 你將短暫遠行 離開我到地球另一頭呼吸\r\n12點 飛機起飛 我偷偷 流下眼淚\r\n才轉身 我就開始想念 你說為我帶回最美的驚喜 我等你\r\n\r\n你和城堡在慕尼黑 我開始神遊產生幻覺\r\n彷彿聽見 皇宮前的手風琴 演奏 動人音樂\r\n你為我紀錄這一切 鏡頭當作我的雙眼\r\n教堂廣場 人潮不減 街頭裝飾著聖誕節\r\n\r\n11月 德國下雪 你呼著 熱騰騰咖啡\r\n你一杯 我也乾杯 學你不加糖喝黑咖啡\r\n第幾天 發狂想念 好遙遠 倒數幾天\r\nCome back  my funny valentine 我的早安 你說goodnight\r\n\r\n你和城堡在慕尼黑 我開始神遊產生幻覺\r\n彷彿看見 一對老夫妻隨著 音樂 跳舞轉圈\r\n你為我紀錄這一切 鏡頭當作我的雙眼\r\n櫥窗點亮 七彩光線 答應下次 帶我一起飛\r\n\r\n我 穿你的拖鞋 擦你的香水\r\n想像你周圍下了雪\r\n我 在城市邊緣 等待你起飛\r\n回來我的世界抱緊我\r\n\r\n你和城堡在慕尼黑 我開始神遊產生幻覺\r\n彷彿聽見 皇宮前的手風琴 演奏 動人音樂\r\n你為我紀錄這一切 鏡頭當作我的雙眼\r\n櫥窗點亮 七彩光線 答應下次 帶我一起飛\r\n\r\n', '', 321, '', '許哲珮', '許哲珮', '陳建良/許哲珮', '種子音樂', '', 1, 1, 0, '2008-06-03 20:08:29', '2015-03-12 13:32:48', '0000-00-00 00:00:00'),
(5139, 1886, 631, 7, 'Pink Dress', '', '2007-05-03 00:00:00', 0000, 30, 0, 1, '你送我的pink dress  \r\n自己買的yellow shoes\r\n香草可樂on ice \r\n星期五的snow dance\r\n\r\n開著我的white beetle\r\n前往你的purple house\r\n月光下有Santa Claus\r\n薄荷味的fish and fries \r\n\r\nCome my prince\r\n\r\nI don’t want to say goodbye, my fairy tales\r\nI don’t want to say goodbye, my very youth\r\nBeautiful childhood\r\n\r\nSay forever, my snowman\r\nI just love to fly away to Neverland\r\nStay young always \r\nBelieve in whatever you dream\r\nImagine whoever you see\r\nIt’s me\r\n\r\n', '', 211, '', '許哲珮', '許哲珮', '林揮斌', '種子音樂', '', 1, 1, 0, '2008-06-03 20:10:31', '2015-03-12 13:32:48', '0000-00-00 00:00:00'),
(5140, 1886, 631, 8, 'Angel Man', '', '2007-05-03 00:00:00', 0000, 30, 0, 1, '我在月光游泳池畔唱歌\r\n唱了一首關於愛的歌\r\n你在台下微微笑的聽著 故事很動人\r\n下雨了 淋溼了我的歌\r\n\r\n寒冷中的咖啡特別香純\r\n情人節的花特別紅潤\r\n星星點綴莫名其妙的浪漫 我覺得傻\r\n傻得可愛 傻得變成一個家\r\n\r\n你就是我的angel man 帶我飛躍 愛的樂園\r\n我盪鞦韆 隨風擺動 旋轉木馬 天放煙火\r\n\r\n我不要Superman or Spiderman\r\n我不要 Batman 不要 Flashman\r\n你是我的是我的 angel man	\r\n我很幸福 唱歌慶祝\r\n\r\n寒冷中的咖啡特別香純\r\n情人節的花特別紅潤\r\n星星點綴莫名其妙的浪漫 我覺得傻\r\n傻得可愛 傻得變成一個家\r\n\r\n你就是我的angel man 帶我飛躍 愛的樂園\r\n我盪鞦韆 隨風擺動 旋轉木馬 天放煙火\r\n\r\n你就是我的angel man (you are my angel man)\r\n鼻子酸了 眼睛下雪\r\n被擁抱著 我輕輕飛\r\n眼睛睜開 是你的臉\r\n\r\n我不要Superman or Spiderman\r\n我不要 Batman 不要 Flashman\r\n你是我的是我的 angel man	\r\n我很幸福 唱歌慶祝\r\n\r\n', '', 252, '', '許哲珮', '許哲珮', '林揮斌', '種子音樂', '', 1, 1, 0, '2008-06-03 20:12:56', '2015-03-12 13:32:48', '0000-00-00 00:00:00'),
(5141, 1886, 631, 9, ' 玻璃鞋', '', '2007-05-03 00:00:00', 0000, 30, 0, 1, '小女孩在路邊拾起了一雙玻璃鞋\r\n以為是灰姑娘丟掉的童話不值錢\r\n她窮得可憐 幻想要一雙玻璃鞋\r\n可這不公平的世界 鞋跟斷了一截\r\n\r\n她左轉圈右轉圈試她的玻璃鞋\r\n跌了跤又摔斷了手鍊還值幾毛錢\r\n她開始流淚 火柴點燃最後光線\r\n舊手鍊是誰留下的紀念\r\n\r\n如果說 有捨便有得 那我得到什麼呢\r\n如果能 丟掉什麼了 換回失去那個人\r\n我願能 變成那首歌 貼近你的靈魂\r\n卻只是 骯髒的灰塵 黏住你的髮根\r\n\r\n如果說 相愛那麼難 忘記卻那麼簡單\r\n怎麼你 選擇了離開 還忍心給我傷害\r\n女孩她 失去了手鍊 換得了一雙鞋\r\n損壞的 依然閃爍著 綻放美麗光圈\r\n\r\n是否能 真心甘情願 重新再愛一回\r\n或還是 無能為力了 只好接受一切\r\n\r\n', '', 257, '', '許哲珮', '許哲珮', '陳建良/許哲珮', '種子音樂', '', 1, 1, 0, '2008-06-03 20:15:23', '2015-03-12 13:32:48', '0000-00-00 00:00:00');
